    return {
      success: true,
      action: "Extracted the duration of the second video",
      extractedData: {
        duration: videoDuration
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
